path_to_dir = r"..\file_words"
path_db = "longman_base.db"

def into_db(path_db, table_name, data):
    sql = """
    INSERT INTO {table_name} (id, word, translate, transcription) VALUES (?, ?, ?, ?)
    """.format(table_name=table_name)
    with sqlite3.connect(path_db) as db:
        cur = db.cursor()
        for data_i in data:
            data_ = list(data_i)
            data_[0:0] = [None]
            xxxxxx = tuple(data_)
            cur.execute(sql, xxxxxx)

def create_db(path_db, table_name):
    with sqlite3.connect(path_db) as db:
        sql = """
        CREATE TABLE IF NOT EXISTS {table_name} (id INTEGER PRIMARY KEY AUTOINCREMENT, word TEXT, translate TEXT,
         transcription TEXT, num_word_garibyan INTEGER)
        """.format(table_name=table_name)
        cur = db.cursor()
        cur.execute(sql)

create_db(path_db, "longman_base")

def get_words(path, sep):
    with open(path) as f:
        data = f.read()
    words = [w.strip() for w in data.split(sep) if w.strip()]
    return words

oxford_words = set(get_words(os.path.join(path_to_dir, "oxford.csv"), "\n"))
longman = set(get_words(os.path.join(path_to_dir, "longman_3000.txt"), ","))
intersection = oxford_words & longman
union = oxford_words | longman

